            class : 'fas fa-user',
            text : ''
        }

    })


    return (
        <div id = 'header'>
            <div id = 'header-block' className = 'container'>
                <div id = 'flexcontainer' className = 'flex'>
                    <div id = 'header-logo'></div>
                    <div id = 'header-manu'>
                        <nav>
                            <ul>
                            {Manu.item.map(item => {
                                console.log(item);
                            })}
                            <li className = {Manu.Account.class}>{}</li>
                            </ul>
                        </nav>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Header
